import React from 'react'
import { MapContainer, TileLayer, useMap } from 'react-leaflet'
import { Marker, Circle } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import L from 'leaflet';

function setupMarkerIcon() {
    delete L.Icon.Default.prototype._getIconUrl;
    L.Icon.Default.prototype._getIconUrl = function (name) {
        return L.Icon.Default.imagePath + '/' + name + '.png';
    };
}


export default function Map() {
    setupMarkerIcon();
    const center = [33.6411, -117.8425]; // UCI Coordinates
    return (
        <div>
            <MapContainer center={center} zoom={13} scrollWheelZoom={false} className="h-full">

            </MapContainer>
        </div>
    )
}
